import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  TextField,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Box,
  Tabs,
  Tab,
  CircularProgress,
  Pagination,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from '@mui/material';
import {
  Bookmark as BookmarkIcon,
  BookmarkBorder as BookmarkBorderIcon,
  Search as SearchIcon,
} from '@mui/icons-material';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';

const ResourceCard = ({ resource, onBookmark, isBookmarked }) => {
  const navigate = useNavigate();

  return (
    <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
      <CardContent sx={{ flexGrow: 1 }}>
        <Typography gutterBottom variant="h6" component="h2">
          {resource.title}
        </Typography>
        <Typography color="text.secondary" gutterBottom>
          {resource.category}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          {resource.description}
        </Typography>
      </CardContent>
      <CardActions>
        <Button
          size="small"
          color="primary"
          onClick={() => window.open(resource.url, '_blank')}
        >
          Visit Resource
        </Button>
        <Button
          size="small"
          color="primary"
          onClick={() => onBookmark(resource)}
          startIcon={isBookmarked ? <BookmarkIcon /> : <BookmarkBorderIcon />}
        >
          {isBookmarked ? 'Bookmarked' : 'Bookmark'}
        </Button>
      </CardActions>
    </Card>
  );
};

const Search = () => {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [query, setQuery] = useState('');
  const [results, setResults] = useState({
    local: { items: [], total: 0, pages: 1, current_page: 1 },
    github: { items: [], total: 0, pages: 1, current_page: 1 },
    arxiv: { items: [], total: 0, pages: 1, current_page: 1 },
  });
  const [loading, setLoading] = useState(false);
  const [tabValue, setTabValue] = useState(0);
  const [bookmarks, setBookmarks] = useState(new Set());
  const [category, setCategory] = useState('all');
  const [page, setPage] = useState(1);

  useEffect(() => {
    if (user) {
      fetchBookmarks();
    }
  }, [user]);

  useEffect(() => {
    if (query) {
      const debounceTimer = setTimeout(() => {
        performSearch();
      }, 500);

      return () => clearTimeout(debounceTimer);
    }
  }, [query, page, category]);

  const fetchBookmarks = async () => {
    try {
      const response = await axios.get('/api/bookmarks');
      const bookmarkIds = new Set(response.data.bookmarks.map(b => b.resource.id));
      setBookmarks(bookmarkIds);
    } catch (error) {
      console.error('Error fetching bookmarks:', error);
    }
  };

  const performSearch = async () => {
    setLoading(true);
    try {
      const response = await axios.get('/api/search/all', {
        params: {
          q: query,
          page,
          per_page: 12,
        },
      });
      setResults(response.data);
    } catch (error) {
      console.error('Error performing search:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleBookmark = async (resource) => {
    if (!user) {
      navigate('/login');
      return;
    }

    try {
      if (bookmarks.has(resource.id)) {
        await axios.delete(`/api/bookmarks/${resource.id}`);
        setBookmarks(prev => {
          const newBookmarks = new Set(prev);
          newBookmarks.delete(resource.id);
          return newBookmarks;
        });
      } else {
        await axios.post(`/api/bookmarks/${resource.id}`);
        setBookmarks(prev => new Set([...prev, resource.id]));
      }
    } catch (error) {
      console.error('Error toggling bookmark:', error);
    }
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
    setPage(1);
  };

  const handlePageChange = (event, value) => {
    setPage(value);
  };

  const handleCategoryChange = (event) => {
    setCategory(event.target.value);
    setPage(1);
  };

  const renderResults = () => {
    if (loading) {
      return (
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="60vh">
          <CircularProgress />
        </Box>
      );
    }

    if (!query) {
      return (
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="60vh">
          <Typography variant="h6" color="text.secondary">
            Enter a search query to find AI learning resources
          </Typography>
        </Box>
      );
    }

    const currentResults = tabValue === 0 ? results.local :
                          tabValue === 1 ? results.github :
                          results.arxiv;

    return (
      <>
        <Grid container spacing={4}>
          {currentResults.items.map((resource) => (
            <Grid item key={resource.id} xs={12} sm={6} md={4}>
              <ResourceCard
                resource={resource}
                onBookmark={handleBookmark}
                isBookmarked={bookmarks.has(resource.id)}
              />
            </Grid>
          ))}
        </Grid>

        {currentResults.pages > 1 && (
          <Box display="flex" justifyContent="center" mt={4}>
            <Pagination
              count={currentResults.pages}
              page={currentResults.current_page}
              onChange={handlePageChange}
              color="primary"
            />
          </Box>
        )}
      </>
    );
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Search AI Resources
      </Typography>

      <Box sx={{ mb: 4 }}>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} md={6}>
            <TextField
              fullWidth
              variant="outlined"
              placeholder="Search for AI tutorials, papers, repositories..."
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              InputProps={{
                startAdornment: <SearchIcon sx={{ mr: 1, color: 'text.secondary' }} />,
              }}
            />
          </Grid>
          <Grid item xs={12} md={6}>
            <FormControl fullWidth>
              <InputLabel>Category</InputLabel>
              <Select
                value={category}
                label="Category"
                onChange={handleCategoryChange}
              >
                <MenuItem value="all">All Categories</MenuItem>
                <MenuItem value="tutorials">Tutorials</MenuItem>
                <MenuItem value="courses">Courses</MenuItem>
                <MenuItem value="papers">Research Papers</MenuItem>
                <MenuItem value="repositories">GitHub Repositories</MenuItem>
                <MenuItem value="blogs">Blogs</MenuItem>
              </Select>
            </FormControl>
          </Grid>
        </Grid>
      </Box>

      <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 3 }}>
        <Tabs value={tabValue} onChange={handleTabChange}>
          <Tab label="Local Resources" />
          <Tab label="GitHub Repositories" />
          <Tab label="arXiv Papers" />
        </Tabs>
      </Box>

      {renderResults()}
    </Container>
  );
};

export default Search;
